    false,nt"url": null,nt"notes": "This data report is the fourth and final
    volume of data and preliminary analysis of data on the cooperative study of the
    ecology of Back Bay, Virginia, and Currituck Sound, North Carolina, from 1958 through
    1964.  A fishery investigation was initiated on Back Bay in 1959 to investigate
    the current status and trends of the largemouth bass fishery; to study the effects
    of increased salinities or other future waterfowlmanagement proposals on largemouth
    bass and other fresh water fish found in the Back Bay area; and to investigate the
    productivity of bottom fauna in relation to various bottom types and turbidities.",nt"license_title":
